import React, { useState, useEffect } from 'react';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';
import { Container, Form, Button, Alert, Table } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';

const Bookings = () => {
  const [selectedDate, setSelectedDate] = useState(new Date());
  const [successMessage, setSuccessMessage] = useState('');
  const [bookingRequests, setBookingRequests] = useState([]);
  const navigate = useNavigate();

  const handleDateChange = (date) => {
    setSelectedDate(date);
  };

  const includeAccessToken = () => {
    const token = localStorage.getItem('access_token');
    return token ? `Bearer ${token}` : '';
  };

  const handleSchedule = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch('/make_booking', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': includeAccessToken(),
        },
        body: JSON.stringify({
          movingDate: selectedDate,
        }),
      });

      if (response.ok) {
        console.log('Booking request submitted successfully!');
        setSuccessMessage('Booking scheduled successfully. Please wait for confirmation from the mover.');
        // Redirect or navigate to another page after scheduling
        navigate('/customer-dashboard'); // Replace '/confirmation' with the actual path
      } else {
        console.error('Failed to submit booking request');
      }
    } catch (error) {
      console.error('Error:', error);
    }
  };

  const fetchBookingRequests = async () => {
    try {
      const response = await fetch('/get_booking_requests', {
        method: 'GET',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': includeAccessToken(),
        },
      });

      if (response.ok) {
        const data = await response.json();
        setBookingRequests(data.bookingRequests);
      } else {
        console.error('Failed to fetch booking requests');
      }
    } catch (error) {
      console.error('Error:', error);
    }
  };

  const handleManageBooking = async (bookingId, action) => {
    try {
      const response = await fetch('/manage_booking', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': includeAccessToken(),
        },
        body: JSON.stringify({
          booking_id: bookingId,
          action: action,
        }),
      });

      if (response.ok) {
        console.log(`Booking ${action}ed successfully!`);
        // Refresh the booking requests
        fetchBookingRequests();
      } else {
        console.error(`Failed to ${action} booking`);
      }
    } catch (error) {
      console.error('Error:', error);
    }
  };

  useEffect(() => {
    // Fetch booking requests on component mount
    fetchBookingRequests();
  }, []);

  return (
    <Container className="container">
      <h2>Schedule Movement</h2>
      <Form>
        <Form.Group controlId="selectedDate" className="form-group">
          <Form.Label>Select Date and Time:</Form.Label>
          <DatePicker
            selected={selectedDate}
            onChange={handleDateChange}
            showTimeSelect
            timeFormat="HH:mm"
            timeIntervals={15}
            dateFormat="MMMM d, yyyy h:mm aa"
            className="form-control"
          />
        </Form.Group>

        <Button variant="primary" type="button" onClick={handleSchedule} className="button-container">
          Schedule Movement
        </Button>
        {successMessage && (
          <Alert variant="success" className="mt-3">
            {successMessage}
          </Alert>
        )}

        {/* Display booking requests for moving companies */}
        {bookingRequests.length > 0 && (
          <div className="mt-4">
            <h3>Booking Requests</h3>
            <Table striped bordered hover>
              <thead>
                <tr>
                  <th>Booking ID</th>
                  <th>Moving Date</th>
                  <th>Moving Time</th>
                  <th>Action</th>
                </tr>
              </thead>
              <tbody>
                {bookingRequests.map((booking) => (
                  <tr key={booking.id}>
                    <td>{booking.id}</td>
                    <td>{booking.moving_date}</td>
                    <td>{booking.moving_time}</td>
                    <td>
                      <Button
                        variant="success"
                        onClick={() => handleManageBooking(booking.id, 'accept')}
                      >
                        Accept
                      </Button>{' '}
                      <Button
                        variant="danger"
                        onClick={() => handleManageBooking(booking.id, 'decline')}
                      >
                        Decline
                      </Button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </Table>
          </div>
        )}
      </Form>
    </Container>
  );
};

export default Bookings;
